const X3matrix = () => {
  return (
    <>
      <div classname="holder">
        <div className="matrix-head">
          <div className="level">1</div>
        </div>
        <div className="downlines"></div>
      </div>
      <style jsx>{`
        .holder {
          width: auto;
          width: 200px;
        }
        .matrix-head {
          background: black;
        }
        .level {
          background: lightblue;
          width: 10%;
        }
      `}</style>
    </>
  );
};

export default X3matrix;
